import { useEffect } from "react";
import { useState } from "react";

//components
import SugarDetails from "../components/SugarDetails";

const Home = () => {
  const [sugars, setSugars] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      const response = await fetch("/api/sugars");
      const data = await response.json();

      if (response.ok) {
        setSugars(data);
      }
    };
    fetchData();
  });

  return (
    <div>
      <div className="workouts">
        {sugars &&
          sugars.map((sugar) => <p key={sugar._id}>{sugar.sugarlvl}</p>)}
      </div>
    </div>
  );
};

export default Home;
